from typing import *
def div(arr:List[int])->List[int]:
    ans=[0]*(10**6+5)
    for k in arr:
        for i in range(2,k+1):
            if i*i>k:
                break
            if not k%i:
                ans[i]=1
                while not k%i:
                    k//=i
        if k>1:
            ans[k]=1
    return ans
