lb = [int(i)for i in input().split()]
fl1 = 1
fl2 = 1
l1 = []
l2 = []

for a in la:
    if a == 1:
        continue
    elif pri(a):
        l1.append(a)

    else:
        for i in range(2,int(a**0.5)+1):
            if a%i == 0:
                if a//i not in l1 and i not in l1:
                    l1.append(a//i)
                    l1.append(i)
